INSERT INTO `good_articles` VALUES ('9', '2018 最火的十大电饭锅', 'img/20181107/282379051f21dbd16a6cb0baa6e3d2aa.png', '2', '<p></p><h1 cid=\"n0\" mdtype=\"heading\"><span md-inline=\"plain\">Laravel Admin 的基本使用</span></h1><p cid=\"n2\" mdtype=\"paragraph\"><span cid=\"n3\" mdtype=\"line\"></span></p><h3 cid=\"n4\" mdtype=\"heading\"><span md-inline=\"plain\">安装以及调试</span></h3><blockquote cid=\"n5\" mdtype=\"blockquote\"><p cid=\"n6\" mdtype=\"paragraph\"><span cid=\"n7\" mdtype=\"line\"><span md-inline=\"plain\">1,安装</span></span></p></blockquote><p cid=\"n8\" mdtype=\"paragraph\"><span cid=\"n9\" mdtype=\"line\"><span md-inline=\"plain\">1，首先确保安装好了</span><span md-inline=\"code\" spellcheck=\"false\"><code>laravel</code></span><span md-inline=\"plain\">，并且数据库连接设置正确。</span></span></p><p></p><pre spellcheck=\"false\" lang=\"cmd\" contenteditable=\"false\" cid=\"n10\" mdtype=\"fences\"><span role=\"presentation\"><span>composer</span> <span>require</span> <span>encore</span><span>/</span><span>laravel-admin</span></span></pre><p cid=\"n11\" mdtype=\"paragraph\"><span cid=\"n12\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">2，然后运行下面的命令来发布资源：</span></span></p><p></p><pre spellcheck=\"false\" lang=\"cmd\" contenteditable=\"false\" cid=\"n13\" mdtype=\"fences\"><span role=\"presentation\"><span>php</span> <span>artisan</span> <span>vendor</span><span>:</span><span>publish</span> <span>--</span><span>provider</span><span>=</span><span>\"Encore\\Admin\\AdminServiceProvider\"</span></span></pre><p cid=\"n14\" mdtype=\"paragraph\"><span cid=\"n15\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">3，在该命令会生成配置文件</span><span md-inline=\"code\" spellcheck=\"false\"><code>config/admin.php</code></span><span md-inline=\"plain\">，可以在里面修改安装的地址、数据库连接、以及表名，建议都是用默认配置不修改。</span></span></p><p cid=\"n16\" mdtype=\"paragraph\"><span cid=\"n17\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">然后运行下面的命令完成安装：</span></span></p><p></p><pre spellcheck=\"false\" lang=\"cmd\" contenteditable=\"false\" cid=\"n18\" mdtype=\"fences\"><span role=\"presentation\"><span>php</span> <span>artisan</span> <span>admin</span><span>:</span><span>install</span></span></pre><p cid=\"n19\" mdtype=\"paragraph\"><span cid=\"n20\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">启动服务后，在浏览器打开 </span><span md-inline=\"code\" spellcheck=\"false\"><code>http://localhost:xxxx/admin/</code></span><span md-inline=\"plain\"> ,使用用户名 </span><span md-inline=\"code\" spellcheck=\"false\"><code>admin</code></span><span md-inline=\"plain\"> 和密码 </span><span md-inline=\"code\" spellcheck=\"false\"><code>admin</code></span><span md-inline=\"plain\">登陆.</span></span></p><p cid=\"n21\" mdtype=\"paragraph\"><span cid=\"n22\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n23\" mdtype=\"paragraph\"><span cid=\"n24\" mdtype=\"line\" contenteditable=\"true\"></span></p><h3 cid=\"n25\" mdtype=\"heading\" contenteditable=\"true\"><span md-inline=\"plain\">快速入手</span></h3><blockquote cid=\"n26\" mdtype=\"blockquote\"><p cid=\"n27\" mdtype=\"paragraph\"><span cid=\"n28\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">laravel admin 最大的作用就是帮助我们快速生成增删改查的代码和 views 所以我们来看一下基本的增删改查管理如何生成</span></span></p></blockquote><p cid=\"n29\" mdtype=\"paragraph\"><span cid=\"n30\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">1，我们如果想要关联一张表需要执行以下指令（以 users 表举例）</span></span></p><p></p><pre spellcheck=\"false\" lang=\"cmd\" contenteditable=\"false\" cid=\"n31\" mdtype=\"fences\"><span role=\"presentation\"><span>php</span> <span>artisan</span> <span>admin</span><span>:</span><span>make</span> <span>UserController</span> <span>--</span><span>model</span><span>=</span><span>App</span><span>\\</span><span>Models</span><span>\\</span><span>User</span></span></pre><p cid=\"n32\" mdtype=\"paragraph\"><span cid=\"n33\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n34\" mdtype=\"paragraph\"><span cid=\"n35\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n36\" mdtype=\"paragraph\"><span cid=\"n37\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">2，这里我们看到 </span><span md-inline=\"code\" spellcheck=\"false\"><code>--model=App\\Models\\User</code></span><span md-inline=\"plain\"> 是代表当前关联的 model 文件，所以如果你没有生成 </span><span md-inline=\"code\" spellcheck=\"false\"><code>App\\Models\\User.php</code></span><span md-inline=\"plain\"> 那么这个指令会报错，如果没有生成 model 文件，需要执行以下指令生成 </span><span md-inline=\"code\" spellcheck=\"false\"><code>User.php</code></span><span md-inline=\"plain\"> 文件</span></span></p><p></p><pre spellcheck=\"false\" lang=\"\" contenteditable=\"false\" cid=\"n38\" mdtype=\"fences\"><span role=\"presentation\">php artisan make:model /Models/User</span></pre><p cid=\"n39\" mdtype=\"paragraph\"><span cid=\"n40\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n41\" mdtype=\"paragraph\"><span cid=\"n42\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n43\" mdtype=\"paragraph\"><span cid=\"n44\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">3，当第一个指令执行成功之后我们会在 </span><span md-inline=\"code\" spellcheck=\"false\"><code>/app/Admin/Controllers/</code></span><span md-inline=\"plain\">文件夹下获得一个 </span><span md-inline=\"code\" spellcheck=\"false\"><code>UserController.php</code></span><span md-inline=\"plain\"> 文件这时候我们需要在 </span><span md-inline=\"code\" spellcheck=\"false\"><code>/app/Admin/routes.php</code></span><span md-inline=\"plain\"> 文件中 配置页面访问 路由</span></span></p><p></p><pre spellcheck=\"false\" lang=\"php\" contenteditable=\"false\" cid=\"n45\" mdtype=\"fences\"><span role=\"presentation\"><span>$router</span><span>-&gt;</span><span>resource</span>(<span>\'users\'</span>, <span>UserController</span>::<span>class</span>); <span>// 这里 users 代表路由名</span></span></pre><p cid=\"n46\" mdtype=\"paragraph\"><span cid=\"n47\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n48\" mdtype=\"paragraph\"><span cid=\"n49\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n50\" mdtype=\"paragraph\"><span cid=\"n51\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">4，当配置好路由文件之后，我们在 laravel-admin 页面当中找到  </span><span md-inline=\"code\" spellcheck=\"false\"><code>menu</code></span><span md-inline=\"plain\"> 按钮并点击</span><br></span></p><p cid=\"n50\" mdtype=\"paragraph\"><span cid=\"n51\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\"><br></span></span></p><p cid=\"n52\" mdtype=\"paragraph\"><span cid=\"n53\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">然后我们就可以配置按钮来访问我们对 </span><span md-inline=\"code\" spellcheck=\"false\"><code>users</code></span><span md-inline=\"plain\"> 表的操作页面了</span></span></p><p cid=\"n54\" mdtype=\"paragraph\"><span cid=\"n55\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"image\" contenteditable=\"false\"><img referrerpolicy=\"no-referrer\" src=\"file://F:/%E6%A1%8C%E9%9D%A2/Desktop/%E6%88%91%E7%9A%84%E5%8D%9A%E5%AE%A2%E5%88%86%E4%BA%AB/Laravel-admin/Laravel-admin/menu-2.png?lastModify=1541593659\" onerror=\"window.onImageErrorFunc(event)\" onload=\"window.onImageLoadedFunc(event)\"></span></span></p><p cid=\"n56\" mdtype=\"paragraph\"><span cid=\"n57\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n58\" mdtype=\"paragraph\"><span cid=\"n59\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n60\" mdtype=\"paragraph\"><span cid=\"n61\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">5，刷新页面我们会看到一个新的 按钮 </span><span md-inline=\"image\" contenteditable=\"false\"><img referrerpolicy=\"no-referrer\" src=\"file://F:/%E6%A1%8C%E9%9D%A2/Desktop/%E6%88%91%E7%9A%84%E5%8D%9A%E5%AE%A2%E5%88%86%E4%BA%AB/Laravel-admin/Laravel-admin/menu-3.png?lastModify=1541593659\" onerror=\"window.onImageErrorFunc(event)\" onload=\"window.onImageLoadedFunc(event)\"></span></span></p><p cid=\"n62\" mdtype=\"paragraph\"><span cid=\"n63\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n64\" mdtype=\"paragraph\"><span cid=\"n65\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n66\" mdtype=\"paragraph\"><span cid=\"n67\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n68\" mdtype=\"paragraph\"><span cid=\"n69\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">6，点击按钮 我们就可以查看生成的 </span><span md-inline=\"code\" spellcheck=\"false\"><code>users</code></span><span md-inline=\"plain\"> 表单操作页面了</span></span></p><p cid=\"n70\" mdtype=\"paragraph\"><span cid=\"n71\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"image\" contenteditable=\"false\"><img referrerpolicy=\"no-referrer\" src=\"file://F:/%E6%A1%8C%E9%9D%A2/Desktop/%E6%88%91%E7%9A%84%E5%8D%9A%E5%AE%A2%E5%88%86%E4%BA%AB/Laravel-admin/Laravel-admin/users.png?lastModify=1541593659\" onerror=\"window.onImageErrorFunc(event)\" onload=\"window.onImageLoadedFunc(event)\"></span></span></p><p cid=\"n72\" mdtype=\"paragraph\"><span cid=\"n73\" mdtype=\"line\" contenteditable=\"true\"></span></p><h3 cid=\"n74\" mdtype=\"heading\" contenteditable=\"true\"><span md-inline=\"plain\">表单的调整 《$form》</span></h3><p cid=\"n75\" mdtype=\"paragraph\"><span cid=\"n76\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\"></span><span md-inline=\"tab\">	</span><span md-inline=\"plain\">在 laravel-admin 中，最先要调节的肯定就是  $form  表单组件这一块了，所以我么就先看看  </span><span md-inline=\"escape\">$</span><span md-inline=\"plain\">form 这里的基本使用</span></span></p><p cid=\"n77\" mdtype=\"paragraph\"><span cid=\"n78\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">1，$form 基本结构</span></span></p><p></p><pre spellcheck=\"false\" lang=\"php\" contenteditable=\"false\" cid=\"n79\" mdtype=\"fences\"><span role=\"presentation\"><span>protected</span> <span>function</span> <span>form</span>(){ &nbsp; </span><br><span role=\"presentation\"><span cm-text=\"\"></span></span><br><span role=\"presentation\"> &nbsp; &nbsp; &nbsp; &nbsp;<span>$form</span> <span>=</span> <span>new</span> <span>Form</span>(<span>new</span> <span>Good</span>); </span><br><span role=\"presentation\"><span role=\"presentation\" cm-text=\"	\">    </span> &nbsp; &nbsp;<span>// 这里 new Good 代表这个表单关联的是 Good Model 也就是关联了Good 这个 model 关联的表<span role=\"presentation\" cm-text=\"	\">   </span></span></span><br><span role=\"presentation\"> &nbsp;  <span role=\"presentation\" cm-text=\"	\">    </span><span role=\"presentation\" cm-text=\"	\">    </span></span><br><span role=\"presentation\"> &nbsp; &nbsp; &nbsp; &nbsp;<span>$form</span><span>-&gt;</span><span>text</span>(<span>\'name\'</span>, <span>\'商品名称\'</span>)<span>-&gt;</span><span>rules</span>(<span>\'required\'</span>);</span><br><span role=\"presentation\"><span role=\"presentation\" cm-text=\"	\">    </span><span role=\"presentation\" cm-text=\"	\">    </span><span>// 这里 name 是 Good 关联表中的 字段 ‘商品名称’ 是页面显示标题内容，rules 是表单验证规则</span></span><br><span role=\"presentation\"><span cm-text=\"\"></span></span><br><span role=\"presentation\"> &nbsp; &nbsp; &nbsp; &nbsp;<span>return</span> <span>$form</span>;</span><br><span role=\"presentation\"><span role=\"presentation\" cm-text=\"	\">    </span><span role=\"presentation\" cm-text=\"	\">    </span><span>// 这里把创建的表单对象返回出去</span></span><br><span role=\"presentation\">}</span><br><span role=\"presentation\"><span cm-text=\"\"></span></span></pre><p cid=\"n80\" mdtype=\"paragraph\"><span cid=\"n81\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n82\" mdtype=\"paragraph\"><span cid=\"n83\" mdtype=\"line\" contenteditable=\"true\"><span md-inline=\"plain\">2，当我们通过</span></span></p><p><p cid=\"n86\" mdtype=\"paragraph\"><span cid=\"n87\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n88\" mdtype=\"paragraph\"><span cid=\"n89\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n90\" mdtype=\"paragraph\"><span cid=\"n91\" mdtype=\"line\" contenteditable=\"true\"></span></p><p cid=\"n92\" mdtype=\"paragraph\"><br></p></p><p cid=\"n84\" mdtype=\"paragraph\"><span cid=\"n85\" mdtype=\"line\" contenteditable=\"true\"></span></p>', '2018-11-07 20:28:48', '2018-11-07 20:28:48');
